import React from 'react';
import { Row, Col } from 'antd';

function AllPost() {
    return (
        <>
        <Row gutter={[32, 32]}>
            <Col xs={24} sm={24} md={24} lg={8} xl={8}>
            </Col>
        </Row>
        </>
    );
}

export default AllPost;
